import React, { Component } from 'react'
import FullWidthGrid from './layout';
import Navibar from '../Coponent/Navibar';

export default class Booking extends Component {
    constructor(props){
        super(props)
        this.state = {
            uid:"s2234",
            last_name: "",
            first_name: "",
            email:"",
            mobile_phone:"",
        }
    }
    handleSubmit1= (event) =>{
        
        let url="http://127.0.0.1:8080/v2/user";
        const data=this.state;
        fetch(url,{
            method: 'post',
            headers:{
                'content-type':'application/json',
                'accept':'application/xml'
            },
            body: JSON.stringify(data)
        }).then((result) => {
            result.json().then((resp)=>{
                console.log(resp)
                if(resp==="Succeed"){
                    this.props.history.push('./signin')
                }
                else if(resp==="Wrong email"){
                    alert("wrong email format,please check")
                }
                else if(resp==="User has existed"){
                    alert("user has existed,please change your email or log in")
                }
                else if(resp==="Incorrect information"){
                    alert("incorrect information,please check!")
                }
                
            })
        })
    }  


    handleInputChange = (event) =>{
        event.preventDefault()
        this.setState({
            [event.target.name] : event.target.value
        })
    }

    render(){
        //const {last_name,first_name,email,mobile_phone}=this.state
        return (
            <>
            <Navibar />
            <FullWidthGrid></FullWidthGrid>
            </>
            );
    }
}
